s to thank them and acknowledge their dedication.','https://www.instagram.com/p/CCqb8ZcAlut/','89000d45fd5c4b168b8272453381af8a','215996-2020-07'),(35,'2020-07-01 00:00:00.000000','Behind The White Coat','IS','85','120','0','All the president bachmates of RIY 20202-21 reached out to many doctors and their families to thank them and acknowledge their dedication.','https://www.instagram.com/p/CCqb8ZcAlut/','89000d45fd5c4b168b8272453381af8a','215996-2020-07'),(36,'2020-07-12 00:00:00.000000','Paper bag day ','CM','08','4','0','ROTARACT CLUB OF DYPIMS organized an event on 12th July 2020, on the occasion of PAPER BAG DAY. RCVN collaborated with them and we made 78 bags and distributed them with precautions.','https://www.instagram.com/p/CCqcepggctd/','89000d45fd5c4b168b8272453381af8a','215996-2020-07'),(37,'2020-07-18 00:00:00.000000','Ludo Tournament','CS','8','2','0','Ice breaking session with RC Salisbury','https://www.instagram.com/p/CDR2Zc2AmII/','89000d45fd5c4b168b8272453381af8a','215996-2020-07'),(38,'2020-07-18 00:00:00.000000','A B C D\'S of Leadership','PD','114','2','0','RCVN and RCKP co-hosted the event along with 7 other clubs. The speaker was Col. Anand. The Parent Rotary was involved. RC PUNE ROYAL, RC PIMPRI, RC BIBWEBADI and RC ZENITH - Match Club Signed.','https://www.instagram.com/p/CC0RTBWg878/','89000d45fd5c4b168b8272453381af8a','215996-2020-07'),(39,'2020-07-26 00:00:00.000000','E zonal Club Orientation','PD','14','2','0','Conducted by district club advisor, Rtr. Umang Shah.','-','89000d45fd5c4b168b8272453381af8a','215996-2020-07'),(40,'2020-07-26 00:00:00.000000','Everything I Never Told You','CS','15','6','0','RCVN hosted this event on the National Parents Day. 4 other clubs - RC Pune Royal, RC Poona Royal, RC Amanora Youngistaan and RC Bulsar CRT 3060 collaborated. Shared family pictures and mentioned the memories attached to them.','https://www.instagram.com/p/CDHCtaVA1JX/','89000d45fd5c4b168b8272453381af8a','215996-2020-07'),(41,'2020-07-26 00