5','0','We conducted our first GBM meeting. This was an ice breaking session where every member introduced themselves.','https://www.instagram.com/p/CCwL02gDvxR/?utm_source=ig_web_copy_link','e37a3c8fd097433e90fd3c0858c17ad3','215650-2020-07'),(47,'2020-07-19 00:00:00.000000','Match-Club','CS','27','24','0','We along with RCPY and RC Pune Hillside conducted an ice-breaking session where every member first introduced themselves and later narrated their funny \"Technical Glitch\" story, after the event hosted by us \"IN\'s and OUT\'s Of GITHUB\". Following that,  we also signed a Match Club Agreement with both the clubs.','https://www.instagram.com/p/CC3Fp7eDPz6/?utm_source=ig_web_copy_link','e37a3c8fd097433e90fd3c0858c17ad3','215650-2020-07'),(48,'2020-07-19 00:00:00.000000','IN(s) AND OUT(s) OF GITHUB','PD','60','48','0','We along with of RCPY and RC Pune Hillside successfully hosted the event \"IN(s) AND OUT(s) OF GITHUB\" which was conducted by Rtr. Prasad Seth. The insightful session included basics of GitHub.','https://www.instagram.com/p/CC3xY5RDGeo/?utm_source=ig_web_copy_link','e37a3c8fd097433e90fd3c0858c17ad3','215650-2020-07'),(49,'2020-07-19 00:00:00.000000','Peritus 1.0','PD','168','150','0','We along with 7 host clubs from Rotaract District 3131 along with 20 collaborating clubs from various districts hosted this event on the occasion of World Youth\'s Skill Day.','https://www.instagram.com/p/CC3un8MDgfn/?utm_source=ig_web_copy_link','e37a3c8fd097433e90fd3c0858c17ad3','215650-2020-07'),(50,'2020-07-19 00:00:00.000000','Peritus 1.0','IS','168','150','0','We along with 7 host clubs from Rotaract District 3131 along with 20 collaborating clubs from various districts hosted this event on the occasion of World Youth\'s Skill Day.','https://www.instagram.com/p/CC3un8MDgfn/?utm_source=ig_web_copy_link','e37a3c8fd097433e90fd3c0858c17ad3','215650-2020-07'),(51,'2020-07-19 00:00:00.000000','Baaltaru','CM','30','72','0','We collabed with RCSAOE for this, which was on tree plantation & awareness about trees & environment. ','https://www.instagram.com/p/CC1BJv_jFDq/?utm_source=ig_web_copy_link','e37a3c8fd097433e90fd3c0858c17ad3','215650-2020-07'),(52,'2020-07-25 00:00:00.000000','Club Bonding Activity','CS','33','6','0','We conducted a fellowship meet (Club Bonding Activity) on google meet, where we played some fun games fro better bonding of club members.','https://drive.google.com/drive/folders/1KT6pH24t_R-Y3AxCe7lU-XgVVTme_gTD?usp=sharing','e37a3c8fd097433e90fd3c0858c17ad3','215650-2020-07'),(53,'2020-07-26 00:00:00.000000','FamExpresso','CS','6','3','0','We collaborated with RC RSCOE, We posted participants photos with their parents on instagram stories and dedicated this to parents.','https://drive.google.com/drive/folders/1iHJP6LKlibejKsRvAMXuhTW7c8y-OGuB?usp=sharing','e37a3c8fd097433e90fd3c0858c17ad3','215650-2020-07'),(56,'2020-07-12 00:00:00.000000','Product Hype','PD','50','12','0','A competition based on the concept of Shark Tank organised under the PD avenue for our club members. There were 11 teams participating to showcase their products in front of a panel of jury members. At the end of the session 3 winners were announced.','https://www.instagram.com/p/CCkoC0Wgfax/?igshid=amb1of90sh7d','fb64afba86c247ca95fd19554331a175','212790-2020-07'),(57,'2020-07-19 00:00:00.000000','Funky Kona (Dabba Painting)','CS','29','3','0','Funky Kona aimed at making mundane objects,like Dabbas, fun and funky . The session was conducted by Alifiya Haideri who guided the members through the process of painting regular kitchen dabbas. The event was carried out under the CSD avenue. The members got a chance to showcase their creativity at the end of the session.','https://www.instagram.com/p/CC0qY9WgMWI/?igshid=1kfad7afdlbnz','fb64afba86c247ca95fd19554331a175','212790-2020-07'),(58,'2020-07-26 00:00:00.000000','Fact It Out! and Mask Making','CM','37','6','0','The two activities were conducted under the CMD avenue. Rtr. Suparna Sahajwalla ,with the help of a presentation, explained the importance of fact checking information from unbiased sources and gave a few recent examples of viral fake news. Rtr. Zainab Kapasi taught the members how to make three layered cotton face masks using materials found at home.','https://www.instagram.com/p/CDItntFA0o9/?igshid=sf0h9ytldaah','fb64afba86c247ca95fd19554331a175','212790-2020-07'),(59,'2020-07-19 00:00:00.000000','Installation ceremony','CM','50','1','0','Installation Ceremony for RIY 2020-21 in the presence of honorable Chief Guest Rtn.Manojeet Chowdhary Sir, President -  Rotary Club of Pune Sports City and honored by DRR. Rtr. Shradha Lamkhede with their Co-teams and other Rotaractors and members of Rotaract Clubs of District.','https://www.instagram.com/p/CC3h9qegQeF/?igshid=kdn03gvtxijd','ccf827237fe7403aae549fd534692339','215185-2020-07'),(60,'2020-07-22 00:00:00.000000','Art of Startup','PD','11','2','0','RC_DPU has come up with an amazing . Personality development session , which is going to give you the motivation to became an \" Entrepreneur \"','https://www.instagram.com/p/CC6UphXAYlS/?igshid=6ptf7plrnaem','ccf827237fe7403aae549fd534692339','215185-2020-07'),(61,'2020-08-26 00:00:00.000000','Kargil Vijay Diwas ','CM','50','1','0','Lets salute the brave hearts, who laid down their lives for our nation, Lets pay tribute to the real heroes on this auspicious day of Kargil Vijay Diwas. More than 500 soldiers laid down their lives in the Kargil War.','https://www.instagram.com/p/CDFxyVfAIGy/?igshid=1911rluu12x8d','ccf827237fe7403aae549fd534692339','215185-2020-07'),(62,'2020-08-28 00:00:00.000000','World Nature Conservation day !!!!!','CM','40','1','0','Celebrated on July 28 each year, World Nature Conservation Day recognizes that a healthy environment is the foundation for a stable and productive society and to ensure the well-being of present and future generations, we all must participate to protect, conserve, and sustainably manage our natural resou