00:00.000000','Ashtang Vinyasa - Yoga Session','PD','62','24','0','On the morning of 11th July, we planned up an online Yoga Session Ashtang Vinyasa.  We learned many Yogasanas taught to us by Ms. Anushka Kuchnure. This session was attended by 60+ Rotaractors, including the Council Members, District Joint - International Service Director Rtr. Rushikesh Dale, District Rotary Rotaract Relationship Officer Rtr Karishma Awari and District General Secretary Rtr. Akash Chikate.','https://www.instagram.com/p/CCgjmQ7gsGW/?igshid=pri4g0y8sj7l','f84868151e06483988da8bc582ff0488','85530-2020-07'),(217,'2020-07-12 00:00:00.000000','Gardening at Home','PD','25','8','0','Rotaract Club of Pune Mid-East collaborated with RC Global Youth who initiated the event by- Kunal a.k.a Madmali on terrace gardening through an instagram live session.  Kunal a.k.a Madmali is a Terrace Gardener and a Video Creator who passionately shares tips, tricks and experiments to achieve that perfect garden one dreams about. n the end he also answered a lot of questions from the audience and we all had an informative session that motivated us to plant more trees.','https://www.instagram.com/p/CCjItxJgzy9/?igshid=1f4cvhv64g4tm','f84868151e06483988da8bc582ff0488','85530-2020-07'),(218,'2020-07-15 00:00:00.000000','Resilient Youth','IS','2','4','0','Initiated By: - Rotaract Club of Bombay Uptown, RID 3141 This project was about the skills which are going to be in demand post covid -19. We had to share across a blog, along with its link, on our various platforms in order to increase awareness. We shared the following drive link along with the flyers on our official Instagram handle. Drive link: - https://drive.google.com/drive/folders/1kkLiR8Tqc163bJR9BORpGbUpynFIDi4P?usp=sharing','https://drive.google.com/drive/folders/1kkLiR8Tqc163bJR9BORpGbUpynFIDi4P?usp=sharing','f84868151e06483988da8bc582ff0488','85530-2020-07'),(219,'2020-07-18 00:00:00.000000','OOPSIE Housie','CS','51','8','0','We Rotaract Club of Pune 