e \" Rotaract Club of Salt Lake Metropolitan.\" The hashtags were - #internationalcousinday #RCSM #cousinslove #internationalevent #love #cousins #family #society. ','-','f84868151e06483988da8bc582ff0488','85530-2020-07'),(222,'2020-07-25 00:00:00.000000','Club Orientation','CS','67','18','0','Rotaract Club of Pune Mid-East conducted Club Orientation on the evening of 25th July 2020.  The orientation was attended by more than 60 club members and prospectives.District Zonal Representative (Zone 6) Rtr. Meet Shah, Asistant Zonal Representative (Zone 6) Rtr Riya Gupta and District Rotary Rotaract Relationship Officer Rtr Karishma Awari gave wonderful presentation on Rotaract Workings, its avenues and opportunities.District Rotaract Representative Rtr. Shraddha Lamkhade and Past President Rtr. Shubham Shelke gave insights on Rotaract.Deputy District Rotaract Representative Rtr Drishti Singh and District Director Without Portfolio Rtr. Tulna Gupta also attending our Club Orientation.','https://www.instagram.com/p/CDG9NImAcqZ/?igshid=1jb6rytyrwjrm','f84868151e06483988da8bc582ff0488','85530-2020-07'),(223,'2020-07-26 00:00:00.000000','FAMEXPRESSO','IS','7','7','0','Initiated By: - Rotaract Club of RSCOE, RID 3131 collaborated with Rotaract Club of Pune Mid-East. The Rotaract club of RSCOE came up with an initiative on the occasion of National Parents Day. Details About Event- We had to post a picture with our families on the flyers provided and also fill up the text box with the message of love and gratitude towards the parents and post/story it on the club social media handles, and Tag @rc_rscoe. Minimum 5 posters were required to be uploaded on our social media handles.','https://www.instagram.com/p/CDolShTA1_z/?igshid=lse71nibzsy3','f84868151e06483988da8bc582ff0488','85530-2020-07'),(224,'2020-07-26 00:00:00.000000','Corporate Behaviour','PD','75','12','0','Rotaract Club of Pune Mid-East collaborated with RC Pune Warje\'s educational Swami Vivekananda series of PD sessi