dguucsrdy&story_media_id=','8986aa170b384276bca1c32cc58f207f','215090-2020-07'),(243,'2020-07-28 00:00:00.000000','World Hepatitis Day','PD','4','4','0','On the occasion of World Hepatitis Day observed around the globe to spread awareness about the infectious diseases called hepatitis. We joined hands with Rotaract Club of Bahauddin Zakaria University Multan along with 18 other international clubs in an online awareness campaign regarding hepatitis with an aim to minimize the threats of contacting the disease by giving necessary awareness to the people. An interactive session by Dr. Arif Saeed who gave us insights on how to take care and precautions as hepatitis is a public health threat. According to WHO, viral Hepatitis causes more than one million deaths each year.','https://www.instagram.com/s/aGlnaGxpZ2h0OjE3ODY3MzQwMjQxOTI0MjAz?igshid=15udguucsrdy&story_media_id=','8986aa170b384276bca1c32cc58f207f','215090-2020-07'),(244,'2020-07-28 00:00:00.000000','I pledge','CM','55','22','0','On World Nature Conservation Day we initiated \"I Pledge\" to take an oath to conserve and protect our natural resources. To take a pledge towards conserving nature and take a picture or short video executing the pledge. We believe to have made tiny steps towards a fruitful impact in nature conservation so that we get to live a healthier future.','https://www.instagram.com/s/aGlnaGxpZ2h0OjE3ODY3MzQwMjQxOTI0MjAz?igshid=31d4msbzr0j8&story_media_id=','8986aa170b384276bca1c32cc58f207f','215090-2020-07'),(245,'2020-07-28 00:00:00.000000','I pledge','PD','55','22','0','On World Nature Conservation Day we initiated \"I Pledge\" to take an oath to conserve and protect our natural resources. To take a pledge towards conserving nature and take a picture or short video executing the pledge. We believe to have made tiny steps towards a fruitful impact in nature conservation so that we get to live a healthier future.','https://www.instagram.com/s/aGlnaGxpZ2h0OjE3ODY3MzQwMjQxOTI0MjAz?igshid=31d4msb