1, and collaborated. We also virtually felicitated the doctors under this project.‍','https://www.instagram.com/p/CC0InsqAsrv/?igshid=11hlqfrvyty5x','7e9e23c5ba904711ab5bf9331aa15660','215663-2020-07'),(283,'2020-07-18 00:00:00.000000','ABCD of Leadership','PD','21','5','0','A seminar was delivered by Col. Prem Anand to the participants on Leadership. He discussed the tips for being a great leader. He also discussed how should one achieve his/her dreams. The seminar was concluded with a Q and A.','https://www.instagram.com/p/CCz-m_5A29Z/?igshid=e02jnlifsdic','7e9e23c5ba904711ab5bf9331aa15660','215663-2020-07'),(284,'2020-07-18 00:00:00.000000','ABCD of Leadership','CS','21','5','0','An ice-breaker session was conducted between all the participants before the seminar. A fun game was played where the participants had to answer their preferences.','https://www.instagram.com/p/CCz-m_5A29Z/?igshid=e02jnlifsdic','7e9e23c5ba904711ab5bf9331aa15660','215663-2020-07'),(285,'2020-07-01 00:00:00.000000','Behind the White Coat','IS','114','120','0','On the occasion of International Doctor\'s Day,we approached  Rotaract clubs from various districts. We reached out many doctors and their family by collecting videos in which they shared their experience and we  broadcasted on Youtube Channel. The Attendees mentioned above are the clubs participating in this event','https://www.instagram.com/p/CCWB9nKALen/?igshid=h75o3200o0om','5502ecd454804ae0aa56c90bf961fd7d','215200-2020-07'),(286,'2020-07-15 00:00:00.000000','Leading towards Good Mental Health','PD','13','10','0','A Joint International Professional Development session was conducted on Mental Health and Emotional Intelligence of Youth by Motivational speaker Ms.Gurpreet Kaur Khalsa on the e-platform Zoom.','https://www.instagram.com/p/CClyF3ag24H/?igshid=1c9lnehedoan5','5502ecd454804ae0aa56c90bf961fd7d','215200-2020-07'),(287,'2020-07-20 00:00:00.000000','Plant from Home','CM','10','20','0','A planting initiative taken by our Club to encourage more plantation to be done from home due to current Lockdown situation. We are collecting photos/videos of the plantation. We approached and collaborated with many Rotaract Clubs.','https://www.instagram.com/tv/CCtXgcIABIE/?igshid=fgja1nwu880','5502ecd454804ae0aa56c90bf961fd7d','215200-2020-07'),(288,'2020-07-24 00:00:00.000000','Orientation Program','PD','17','5','0','This Joint Orientation program helped 170+ rotaractors and new members to understand all about Rotaract. All the doubts and queries were cleared and it was an amazing session','https://www.instagram.com/p/CDGoQY6A6dB/?igshid=1ppa6ozidw1qm','5502ecd454804ae0aa56c90bf961fd7d','215200-2020-07'),(289,'2020-07-28 00:00:00.000000','Know Trees Grow trees','CM','6','10','0','An Initiative to plant seeds  and gift plant to our  neighbours by making our planet a better place. The moto was also to share about the importance of that plant. We RCP Urja collaborated for this event and shared the photos with the benefits of that plant','https://www.instagram.com/p/CDLy1grgYpn/?igshid=1cndd9s069rk9','5502ecd454804ae0aa56c90bf961fd7d','215200-2020-07'),(290,'2020-07-01 00:00:00.000000','Behind the white coat','IS','180','72','0','Covid-19 has affected everyone globally. Some of the most important and yet at risk groups in the pandemic include doctors, and Rotaract Club of Amanora Youngistan, along with several others, provided a platform for them to share their views and voice their concerns. A dedicated YouTube channel was set up to host all videos submitted and the audience got to know our Covid-19 warriors a little better. Over 80 clubs joined in this program internationally and it was a huge success.','https://www.instagram.com/p/CChk_DWAKFp/?igshid=c0ss4hysex6t','730cfee2ff9e4c1b9aa68322f165b065','215992-2020-07'),(291,'2020-07-09 00:00:00.000000','LinkedIn Launch','CS','13','2','0','We launched our club\'s LinkedIn profile and took a step forward towards our professional world. Find us at:- https://www.linkedin.com/company/rotaract-club-of-amanora-youngistan So now RC Amanora Youngistan is on Instagram, Facebook, YouTube and LinkedIn.','https://www.instagram.com/stories/rca_youngistan/2373553743472910764?utm_source=ig_story_item_share&','730cfee2ff9e4c1b9aa68322f165b065','215992-2020-07'),(292,'2020-07-07 00:00:00.000000','Declutter','CM','120','15','0','The Pandemic situation hasn\'t been favorable to anyone\'s mental health. Oftentimes it\'s observed that a person might be falling into the clutches of a mental illness but miss the warning signs. Declutter was a project intended to raise awareness about loss of mental wellbeing as well as provide some simple tasks to bring about temporary relief. This event was carried out through our official instagram page @rca_youngistan and got a healthy response.','https://www.instagram.com/p/CCREk9jAdha/?igshid=bvt8pooc1euh','730cfee2ff9e4c1b9aa68322f165b065','215992-2020-07'),(293,'2020-07-11 00:00:00.000000','Fun with Graphology','PD','75','1','0','It can be said that one\'s handwriting is the window to one\'s personality. Keeping this in mind, Rotaract Club of Amanora Youngistan joined hands with Rotaract Club of Pune Camp Pioneers and hosted a professional development session on reading basic traits of one\'s personality based on ones handwriting. The guest speaker invited was the founder of GraphA (a handwriting analysis organization) - Dhwanika Shah - who instructed everyone on what to look for and how to interpret the subtleties on one\'s own handwriting. The session was attended by over 75 Rotaractors and was followed by a club service event.','https://www.instagram.com/p/CCgUPDIgLzS/?igshid=5vju8iippq6t','730cfee2ff9e4c1b9aa68322f165b065','215992-2020-07'),(294,'2020-07-11 00:00:00.000000','Pehchan Kon','CM','35','2','0','This club service session immediately succeeded \"Fun with Graphology\" and involved several clever riddle games such as \"Guess the movie\", \"Guess the brand\" and \"Complete the sentence\". Hosted by Rtr. Tasleem Inamdar, the CSD of RC Pune Camp Pioneers, it served as a relaxing and much needed bonding session for all attending Rotaractors.','https://www.instagram.com/p/CCgUf8JgZ1v/?igshid=1pmwlrvsf9ruf','730cfee2ff9e4c1b9aa68322f165b065','215992-2020-07'),(295,'2020-07-18 00:00:00.000000','The Job Hunt 1.0 ','PD','55','3','1950','The first impression of a candidate when she/he applies for a job is her/his resume. With this in mind, we designed an event to improve resume writing skills of young professionals. A guest talk was given on topis of resume writing by PDRR Rtn Naveen Senna, followed by a resume writing workshop. This event concluded with having participants submit their resumes evaluated by professionals in their respective fields and gain feedback on the same.','https://www.instagram.com/p/CCyqL_yATaj/?igshid=z0byyneezjfc','730cfee2ff9e4c1b9aa68322f165b065','215992-2020-07'),(296,'2020-07-26 00:00:00.000000','Caring Connections','CM','8','1','0','Sometimes life is tough, and not everyone has a listening ear for their problems. This project is aimed to correct that with the help of our parent Rotary Club - Rotary Club of Amanora. There will be anonymous sessions where participants can vent and talk about their troubles to volunteers from Rotary Club of Pune Amanora. It is an year long project and has the potential to help plenty of people through mental and emotional support. Each slot will consist of maximum 5 people and our 2 counselors.','https://www.instagram.com/p/CDHcM9GAYPa/?igshid=13at0615pt996','730cfee2ff9e4c1b9aa68322f165b065','215992-2020-07'),(297,'2020-08-26 00:00:00.000000','Things I\'ve never said','IS','14','3','0',' About - Oftentimes, the gratitude and the love we feel for our parents can go unshared or unsaid. This parents\' day, partenered with Rotaract Club of Viman Nagar, Rotaract Club of Poona Royal \"Everything I Never Told You\" was all about celebrating that love. Participants from various districts shared either an old recreation of a photograph or a greeting card to their parents acknowledging all that\'s been unsaid.','https://www.instagram.com/tv/CDUHf8rlavH/?igshid=5dll36id65c0','730cfee2ff9e4c1b9aa68322f165b065','215992-2020-07'),(298,'2020-07-19 00:00:00.000000','Baltaru','CM','15','5','0','What\'s one of the best way to combat air pollution? Planting your own little tree, of course! This project aimed to have volunteers plant trees and take pics of those tiny beings growing up to share. A joint project with RC SAOE in collaboration with 13 more clubs from RID 3131, this project celebrated all green life and hoped for a healthier planet.','https://www.instagram.com/p/CC02iKagInx/?igshid=ddnzjrbypruh','730cfee2ff9e4c1b9aa68322f165b065','215992-2020-07'),(299,'2020-07-30 00:00:00.000000','Madhumeha','IS','338','7','0','\"Madhumeha\" is another word for diabetes. Millions are afflicted globally and suffer, yet not all of them are very well aware of this disease. Madhumeha aimed to create awareness on diabetes - a terrible disease so that people viewing/participating may be better equipped to deal with it in future. It had 3 main phases - first, an awareness via posters, second, a public opinion survey on type-2 diabetes awareness, third, a placard collage, and we also had a PD session by renowned Doctor A.Mythili MD, DM, FACE. For this project, we collaborated with RAC Vizag City RID 3020, RAC Hyderabad Himayat Nagar RID 3150, RAC Bangalore west RID 3190, RAC Bharathi Vidyapeeth Belapur RID 3142, RAC Laketown','https://www.instagram.com/tv/CDTjybblaPC/?igshid=vn1djg3rherw','730cfee2ff9e4c1b9aa68322f165b065','215992-2020-07'),(300,'2020-07-01 00:00:00.000000','Behind the White Coat','IS','16','120','0','Rotaract club of Pune Zenith in collaboration with 100+ clubs from 7 countries, president elects from district 3131 and healthcare professionals presents a project to pay tribute to our Covid-19 warriors on the occasion of  National Doctors Day and give them a platform to express themselves. We proudly share video by Dr. Jyoti Shinde on the subject of Covid-19 pandemic.','https://www.instagram.com/p/CCv4IpZA2vl/?igshid=sy5nqu4ny9gw','36cfbc4e2ccc48d4a51335f7899aafcd','217271-2020-07'),(301,'2020-07-04 00:00:00.000000','STAR - BOD Training Program','CS','14','8','0','BOD Training Program','https://www.instagram.com/p/CCyZhTHA810/?igshid=1itwpg88huz1z','36cfbc4e2ccc48d4a51335f7899aafcd','217271-2020-07'),(302,'2020-07-05 00:00:00.000000','STAR - BOD Training Program','CS','14','8','0','BOD Training Program','https://www.instagram.com/p/CCyZhTHA810/?igshid=1itwpg88huz1z','36cfbc4e2ccc48d4a51335f7899aafcd','217271-2020-07'),(303,'2020-07-11 00:00:00.000000','Life is a Hobby','PD','14','3','0','We, Rotaract club of Pune Zenith, hosted the first joint event in collaboration with 22 clubs under the avenue of Professional development, Club Services and International Services.  The session was conducted virtually by Mr. Milind Tambe and was attended by 250+ Rotaractors from India and Nigeria. ','https://www.instagram.com/p/CC1OdeYAHro/?igshid=agattvbo1l0k','36cfbc4e2ccc48d4a51335f7899aafcd','217271-2020-07'),(304,'2020-07-11 00:00:00.000000','Life is a Hobby','IS','14','3','0','We, Rotaract club of Pune Zenith, hosted the first joint event in collaboration with 22 clubs under the avenue of Professional development, Club Services and International Services.  The session was conducted virtually by Mr. Milind Tambe and was attended by 250+ Rotaractors from India and Nigeria. ','https://www.instagram.com/p/CC1OdeYAHro/?igshid=agattvbo1l0k','36cfbc4e2ccc48d4a51335f7899aafcd','217271-2020-07'),(305,'2020-07-12 00:00:00.000000','Paper bag Day','CM','16','13','0','We, Rotaract club of Pune Zenith in collaboration with Rotaract club of DYPIMS celebrated, World Paper bag day. The main objective was to distribute paper bags to the nearest medical store as a thank-you gesture. The special touch to this event was members making the bags by themselves and mentioning some quotes on the same. We made and distributed 152 paper bags in a day due to which the event was a great success. The event was done with due safety and care considering the COVID situations.','https://www.instagram.com/p/CCyaTvyg4YW/?igshid=6pnfz3kpgrwi','36cfbc4e2ccc48d4a51335f7899aafcd','217271-2020-07'),(306,'2020-07-18 00:00:00.000000','ABCD of Leadership','PD','11','3','0','RC Pune Zenith in collaboration with Rotaract club of Koregaon Park and Rotaract club of Viman Nagar hosted a PD session on the topic A B C D’s of Leadership with a fantastic attendance of 110+ attendees! It was Co - Hosted By - 1. RC Bibwewadi  2. RC Kalyani Nagar 3. RC Pimpri  4. RC Panvel Central 5. RC Nigdi 6. RC Pune Royal. We started with an ice breaker session \"WOULD YOU RATHER\" CSD activity for all the participants, followed by inspiring thoughts, real life stories and examples of leadership by Col. Prem Anand','https://www.instagram.com/p/CC8cSxggGM2/?igshid=1t3ech353mpb6','36cfbc4e2ccc48d4a51335f7899aafcd','217271-2020-07'),(307,'2020-07-19 00:00:00.000000','Club Orientation Program','CS','13','2','0','We, Rotaract Club of Pune Zenith along with Rotaract club of Pune Warje and Rotaract club of Pune Sinhagad Road successfully conducted a Joint Club Orientation Program. It was a very insightful session wherein our club members and prospectives were enlightened more about Rotaract, it\'s functioning and it\'s opportunities.','https://www.instagram.com/p/CC84akugqtc/?igshid=1jqxq691fzgqh','36cfbc4e2ccc48d4a51335f7899aafcd','217271-2020-07'),(308,'2020-07-24 00:00:00.000000','Vighnaharta','CM','22','45','0','Considering the COVID crisis, we Rotaract club of Pune Zenith have come up with a CMD initiative to create a festive vibe. We are providing an online platform to book your eco friendly bappa. Bookings will start from 24th July, 2020 Friday. To avoid huge crowds, a lot of centers have been arranged. You can pick up the idols from centers near your house. The funds generated from this will be used for women empowerment program.','https://www.instagram.com/p/CDBdsgIAvqz/?igshid=ezhp6g2riim6','36cfbc4e2ccc48d4a51335f7899aafcd','217271-2020-07'),(309,'2020-07-25 00:00:00.000000','Farmaish','CS','8','4','0','Rotaract Club of Pune Zenith along with their Parent Rotary club and the Sibling Rotaract clubs successfully carried out the Musical event \"Farmaish- The Musical eve“ with Singer/Guests for the night- Dr. Aishwarya Sahastrabuddhe, Vallabh Nare & Adv. Shivam Bhouradkar. With more than 160 audience the event was successfully done, where people sent their \'Framaish\' via a google forms.','https://www.instagram.com/p/CDLImtlgNrz/?igshid=119b9wex1vszw','36cfbc4e2ccc48d4a51335f7899aafcd','217271-2020-07'),(310,'2020-07-26 00:00:00.000000','Kargil Divas','IS','22','1','0','Rotaract club of Pune Zenith in collaboration with RC Modern College, Ganeshkhind, pay tribute to our Unsung Warriors on the occasion of Kargil Divas. The Unsung Warrior – Major Mariappan Saravanan.','https://www.instagram.com/p/CDF2jXJgG9V/?igshid=688o5fqc7y9a','36cfbc4e2ccc48d4a51335f7899aafcd','217271-2020-07'),(311,'2020-07-26 00:00:00.000000','Ice Breakers Session','CS','17','5','0','We Rotaract club of Pune Zenith arranged an Ice Breakers session for all the Zenithians to get to know more about each other. We played 2 ice breaker games – How well do you know? and The Memorable Event. It was a successful CSD activity - an evening spent well - knowing each other, filled with fun and laughter.','https://www.instagram.com/p/CDNvAfEArpg/?igshid=ii2th6zumg1s','36cfbc4e2ccc48d4a51335f7899aafcd','217271-2020-07'),(312,'2020-08-29 00:00:00.000000','Caption the Tiger','CS','22','7','0','For all the creative minds, On International Tigers Day, we Rotaract club of Pune Zenith had another fun event - CAPTION THE TIGER - where you have to come up with innovative captions for the pictures posted on our Instagram story. At the end of the day, the winners got featured on our Instagram page.','https://www.instagram.com/p/CDNstHdg2B8/?igshid=625dxy2mazu7','36cfbc4e2ccc48d4a51335f7899aafcd','217271-2020-07'),(313,'2020-07-01 00:00:00.000000','Doctor\'s Day','CM','31','24','0','Dedicated a video made by the members of Rotaract Club of Panvel Central to the Doctors who have relentlessly working since years and especially during the pandemic phase. Certificates of  Appreciation were also given. ','https://www.instagram.com/tv/CCGOvxJp7KN/?igshid=1ovwopx2hty8','4e36f62a5b8e434f8c70337015aee459','214399-2020-07'),(314,'2020-07-12 00:00:00.000000','Little Paw','CM','102','192','0','Rotaract Club of Panvel Central along with 24 collaborating clubs fed the street animals who have been affected the most during the COVID-19 pandemic. ','https://www.instagram.com/tv/CCiDJ9iJjLZ/?igshid=2qhrgb0znm54','4e36f62a5b8e434f8c70337015aee459','214399-2020-07'),(315,'2020-07-12 00:00:00.000000','Little Paw','IS','102','192','0','Rotaract Club of Panvel Central along with 24 collaborating clubs fed the street animals who have been affected the most during the COVID-19 pandemic. ','https://www.instagram.com/tv/CCiDJ9iJjLZ/?igshid=2qhrgb0znm54','4e36f62a5b8e434f8c70337015aee459','214399-2020-07'),(316,'2020-07-19 00:00:00.000000','Bekhauf','IS','63','168','0','Rotaract Club of Panvel Central along with 6 other clubs and an Youtube Channel conducted a Women’s Empowerment project to mark the First Women\'s Rights Movement (19th July, 1848),expressed by dancing their hearts out to \"KUDI NU NACHNE DE\"','https://www.instagram.com/tv/CC0dHMEJQZ7/?igshid=53qkas4geszu','4e36f62a5b8e434f8c70337015aee459','214399-2020-07'),(317,'2020-07-01 00:00:00.000000','Bhagwat Geeta Shlokas','PD','400','8760','0','This ie a year long project , wherein everyday 2 verses/Shlokas of the Bhagwat Geeta are shared on the instagram and facebook page of the club which is needed especially during the pandemic for emotional and mental enlightenment.','https://www.instagram.com/s/aGlnaGxpZ2h0