/ISD/PR The RIY 2020-21 Presidents Batchmates took an initiative to dedicate the Guardians of the Society i.e. the doctors. Around 70+ clubs were a part of this initiative. The videos collaboration was done by taking videos from different doctors video about their experience in the pandemic situation. RcAundh gave their contribution by giving the video of Dr. Leena Shah. Doctor gave her insights on the Pandemic situation and gave advices and remedies of staying safe during the pandemic times. This videos were telecasted on Youtube and IGTV as a Part of PR.','https://www.instagram.com/p/CDKDYUAgjZv/?utm_source=ig_web_copy_link','ed5fc573f8494f9fa8705076e1c0eaf4','91876-2020-07'),(325,'2020-07-01 00:00:00.000000','Cake Cutting for New RIY 2020-21','CS','12','1','0','01/07/20 at 5:30pm Cake Cutting CSD As the new year had commenced the PST had planned a surprise meet with the BOD members living in and around Aundh. We met for a Small cake cutting and Later the Pres/ Sec addressed the BOD members about the coming year and events and also guided everyone with some Motivational Speech in the end. Around 12 Bod and members attended the Event. We Were also accompanied by two Prospective members i.e Sanat Bhat and Abhishek Mukherjee.','https://www.instagram.com/p/CDHty4NADuq/?utm_source=ig_web_copy_link','ed5fc573f8494f9fa8705076e1c0eaf4','91876-2020-07'),(326,NULL,'Unnave Maruthu.','IS','5','3','0','01/07/20 Unnave Maruthu. ISD Rtr. Club of Aundh participated in Unnave Maruthu hosted by Rtr. Club of International college of Aviation, RID 3232, Chennai. The Video was shot by Rtr Suyash Darade from Rc aundh. The task was to make a healthy dish for which Suyash had made a Chicken Salmon Quinoa Salad.','https://www.instagram.com/tv/CDHw1n6AAfy/?utm_source=ig_web_copy_link','ed5fc573f8494f9fa8705076e1c0eaf4','91876-2020-07'),(327,'2020-07-08 00:00:00.000000','Dumb Charades','CS','17','3','0','08/07/20 Dumb Charades CSD The Famous game of Dumb Charades was Played by about more than 17-18 members from the club. The Game was Conducted on Zoom. It was highly Great to see the Enthusiasm of the Prospective members involving in the Game and taking the Lead in becoming the teams captain. The event was planned for 45 mins but got extended for more than 2 hrs .','https://www.instagram.com/p/CDSDUbfANjY/?utm_source=ig_web_copy_link','ed5fc573f8494f9fa8705076e1c0eaf4','91876-2020-07'),(328,'2020-07-08 00:00:00.000000','Tshirt Donation','CM','5','4','0','08/07/20 Tshirt Donation CMD/PR Rc Aundh was able to donate about 50 T-shirts to the needy Construction Workers in  Pirangut area. During Lockdown the Workers were unable to Purchse the clothes and were in need of the same so as an extended version of Daan karona the event was taken. This event also marked for the Oflline PR for the club in the Out skirts of Pune City. This event was carried out by Rtr. Shubham navale to deliver it to Construction site.','https://www.instagram.com/p/CDKN_APA4Ms/?utm_source=ig_web_copy_link','ed5fc573f8494f9fa8705076e1c0eaf4','91876-2020-07'),(329,'2020-07-11 00:00:00.000000','Rotary club of Aundh Installation','CS','11','2','0','11/07/20 at 7:00pm Rotary Installation RRRO/CSD Rotary club of Aundh the Parent Rotary club, had its Installation for the RIY 2020-21.  Around 10 members along with President and Secretary of Rotaract club aundh from the club gave their presence with some good wishes and their guidance.','-','ed5fc573f8494f9fa8705076e1c0eaf4','91876-2020-07'),(330,'2020-07-12 00:00:00.000000','Blood Donation','CM','15','5','0','12/07/20 8:00 am to 2:00 pm Blood Donation CMD/RRRO Blood Donation drive was carried out by Rc Aundh along with Rotary Aundh, Om Blood Bank and Baner Balewadi Medical Association. This event was taken out to ensure and help the society in the pandemic situation with the Blood donation. RcAundh was able to Collect around 34 blood bags. This Blood bags will be used in the Covid centres for help of people. Also a PR campaign was carried out inorder to make the masses aware of the Blood Donation and its important.','https://www.instagram.com/p/CDKPKEaAT4t/?utm_source=ig_web_copy_link','ed5fc573f8494f9fa8705076e1c0eaf4','91876-2020-07'),(331,'2020-07-04 00:00:00.000000','District training. S.T.A.R.','CS','17','4','0','The District training was carried out by the District Council for the BOD training and to know the technicalities of the avenues 18 BOD members from the BOD attended the Training session. it was an helpful session to make the BOD their roles and responsibilities as a director.','-','ed5fc573f8494f9fa8705076e1c0eaf4','91876-2020-07'),(332,'2020-07-12 00:00:00.000000','Rise above Stress','IS','80','6','0','12/07/20 at 5:30pm Rise above Stress WR/PDD/ISD During this Lockdown Period many People come across mental stress situation. So as to release that effect Menrtal Awareness Campaign was carried out. This session was conducted by DR. Aditi Deo. She explained the importance of mental health nd the tricks associated for gaining mental relaxations in the pandemic situation. This Session was Hosted by RC Aundh Along with RC DyPACS, RC Thane lake City, RC Madurai North, RC Mumbai mulund South. This Session was attended by 80+ Members.','https://www.instagram.com/p/CDPbHUYgFtg/?utm_source=ig_web_copy_link','ed5fc573f8494f9fa8705076e1c0eaf4','91876-2020-07'),(333,'2020-07-15 00:00:00.000000','Rotary Rotaract Meet','CS','33','2','0','15/07/20 7:00pm Rotary Rotaract meet CSD/RRRO The Rotary Rotaract Meeting was Planned by Rtr. Saket Kodaskar, RRRO 2020-21. Wherein the Rotarians and Rotaractors gave their insights about their Specific year. This session commenced by introduction the Pres/ Sec and all the BODs and all the members. The Session was followed by some fun activities in the end. The session was attended by 15 Rotaractors and 13 Rotarians , also DRRRO Rtr. Karishma Awari and Rotary District Youth director gave their presence.','-','ed5fc573f8494f9fa8705076e1c0eaf4','91876-2020-07'),(334,'2020-07-17 00:00:00.000000','Scribble','CS','18','2','0','17/07/20 at 8:45pm Scribble CSD The event was planned as a surprise game to the members as an unofficial meet. The game was to guess the drawings made by fellow players and gain points. It was attended by 17 rotaractors from the club. People made some weird drawing and gave some hilarious guessing. The event was a lot fun and Rtr. Sanat Bhat was declared the winner.','https://www.instagram.com/p/CDSC5btAM4G/?utm_source=ig_web_copy_link','ed5fc573f8494f9fa8705076e1c0eaf4','91876-2020-07'),(335,'2020-07-18 00:00:00.000000','Virtual youth exchange ','CS','18','2','0','18/07/20 at 6:00pm Virtual youth exchange Water mission programme meeting RRRO/CSD This session was conducted by rtn. Yogini Joshi to know about the cultural exchanges done around the world. The event was later followed with the topic of Water mission Programme. The PST, Core members and the RRRO took a part in this meeting and gave their insights and various aspects related to the topic.','-','ed5fc573f8494f9fa8705076e1c0eaf4','91876-2020-07'),(336,'2020-07-19 00:00:00.000000','Nexus 1.0. Resume writing','PD','78','3','0','19/07/20 Nexus 1.0. Resume writing PDD/PAO This was an inauguration of the Nexus Series for professional development. The topics covered were  -Development of Personality. -Professional Behaviour -Interview discussions He covered various aspects related to the topic. This event was attended by DPDD Vaishnavi DRRRO and various rotaractors and rotarians from the district.  Total people joined in for the event was 78.','https://www.instagram.com/p/CDPbuXhgz1g/?utm_source=ig_web_copy_link','ed5fc573f8494f9fa8705076e1c0eaf4','91876-2020-07'),(337,'2020-07-22 00:00:00.000000','Bollywood Quiz','CS','25','3','0','22/07/20 at 9:00pm Bollywood quiz CSD The game wherein almost 25 rotaractors from the club joined in the whatsapp group . The event was to identify the Bollywood posters and recognise them at the earliest. It was quite funny as some posters were very famous movies and some were very vague. Rtr. Shreyas Kharolkar won the game by a fair margin.','https://www.instagram.com/p/CDSDyOdAckx/?utm_source=ig_web_copy_link','ed5fc573f8494f9fa8705076e1c0eaf4','91876-2020-07'),(338,'2020-07-26 00:00:00.000000','Nexus 2.0. How to win at Networking','PD','85','3','0','26/07/20 at 5:30pm Nexus 2.0. How to win at Networking PDD The session was taken by rtr Tanuj Ulangwar. He discussed some key points in the field of networking and also gave some insights on building network in the real life. Around 90 rotaractors/participants joined in for the event. He gave 7 Golden Rules that one need to follow in order to get benefitted in terms of networking. The audience attending the sessions were delighted by the rules , tricks and tips that he suggested in terms of networking. It was attended by an audience of more han 90+Rotaractors/ Rotarians / Non Rotaractors. Larter a task was allotted spontaneously to the two participants Isha and Rohit to get to know each othe','https://www.instagram.com/p/CDPZVlsAUra/?utm_source=ig_web_copy_link','ed5fc573f8494f9fa8705076e1c0eaf4','91876-2020-07'),(339,'2020-07-29 00:00:00.000000','Womansik Swasthya','PD','63','6','11972','29/07/20 at 7:00pm Womansik Swasthya WR/PDD This event was conducted under the WR initiative and a PDD initiative exclusively for girls and women. The event was conducted by Speaker Ms. Simran Alekar, who is an Mental Health Trainer. This event was focused to deliver some mental help to women who have faced some Mental and Emotional Health complications in their Family and social life. As the lockdown had begun the work of women was increased significantly so as to ease their emotional stability the session was carried out. The session had entry fee of Rs.49 which as a fund raiser for the Donation of Sanitary Napkins in the peripheral parts of Pune. Total amount that was raised from the eve','https://www.instagram.com/p/CDUU-G7gDn2/?utm_source=ig_web_copy_link','ed5fc573f8494f9fa8705076e1c0eaf4','91876-2020-07'),(340,'2020-07-26 00:00:00.000000','Life of an Army man','PD','60','2','0','26/07/20 at 11:00am Life of an Army man PDD Rc Pune Hill Side along with Rc aundh and othe clubs hosted an event on Life of an Army Man” on the occasion of Kargil Vijay Divas. The Speaker were a Rtd. Major General J.P.Nayar Sir. He tought lessons on Leadership, Unquestionability and Integrity. The Session started at 11am followed by national anthem it was a Great Pride to attend session of attending the session of such distinguished Personality.','-','ed5fc573f8494f9fa8705076e1c0eaf4','91876-2020-07'),(341,'2020-07-30 00:00:00.000000','Investors Awareness Programme','PD','53','2','0','30/07/20 Investors Awareness Programme PDD/ISD Money Managemnet is certainly a great technique to save and make money. Rc EMCOE Metro along with Rc Aundh, RcDYPIM, Rc Pune Metro arranged the session. The event was taken by Priyanka Acharya on behalf NSE. She is a registered Trainer in NSE and a Finance manager. She gave her insights on Money handling and its right Investment Strategies.','https://www.instagram.com/p/CDjOtdOgE2O/?utm_source=ig_web_copy_link','ed5fc573f8494f9fa8705076e1c0eaf4','91876-2020-07'),(342,'2020-07-27 00:00:00.000000','Organic fertilizer Donation','CM','15','2','3411','27/07/20 This event was organised by RC Bibwewadi for organizing the donation for Organic Fertilizers for farmers in Mulshi. and as FD initiative we could raise about 3411/-rs for this cause.','-','ed5fc573f8494f9fa8705076e1c0eaf4','91876-2020-07'),(343,'2020-07-09 00:00:00.000000','Say No To Plastic','IS','16','4','0','This was an initiative of the Rotaract Club of Geetanjali,Kolkata. We took a selfie with a jute or cotton bag, made a collage of the members participated from our side to show our support to this movement, while posting it on instagram.','https://www.instagram.com/p/CC6SIiQAycJ/?utm_source=ig_web_copy_link','59de4d891e8742be959eccf7e43a73dc','217239-2020-07'),(344,'2020-07-12 00:00:00.000000','Paper Bag Day','CM','6','5','0','This event was initiated by RC DYPIMS, on the Occasion of Paper Bag Day on 12th of july, each member had made a count of 5-10 paper bags and gave it to there nearest medical store which used plastic bags and asked them to use paper bags mostly as they are nature friendly.','https://www.instagram.com/p/CC6UpMDA8vu/?utm_source=ig_web_copy_link','59de4d891e8742be959eccf7e43a73dc','217239-2020-07'),(345,'2020-07-15 00:00:00.000000','Roses and thorns','CS','12','8','0','It was a fun introductory game for everyone to know each other a bit better through their roses and thorns which are basically their good and bad qualities . Along with it we also played two truths and one lie wherein the participants had to find out which one is the lie and who ever looses had to complete a dare. It was an ice breaker event for everyone to be a bit more comfortable with each other and everyone really enjoyed it!','https://www.instagram.com/p/CC6VS3ugvXR/?utm_source=ig_web_copy_link','59de4d891e8742be959eccf7e43a73dc','217239-2020-07'),(346,'2020-07-16 00:00:00.000000','Plasma Donation Awareness','IS','0','3','0','Plasma Donation Awareness was an initiative of Rotaract Club of Jalgaon West in which we spread the awareness to the masses by posting on Instagram','https://www.instagram.com/p/CDez4dOg-Ft/?utm_source=ig_web_copy_link','59de4d891e8742be959eccf7e43a73dc','217239-2020-07'),(347,'2020-07-17 00:00:00.000000','Introduction to Parent Rotary','CS','7','4','0','We had a fun meeting with Parent Rotary- Rotary Club of Pune Hillside and understood their functioning. They also discussed their upcoming events.','https://www.instagram.com/p/CC6ZbPDgx3X/?utm_source=ig_web_copy_link','59de4d891e8742be959eccf7e43a73dc','217239-2020-07'),(348,'2020-07-19 00:00:00.000000','GitHub ','PD','13','9','0','Mr. Prasad Seth briefed us about GitHub and what it is about, why and where it is used along with its pros and cons. It was truly an enlightening event for all the attendees and the question answer round was also very interactive making sure everyone had a few takeaways from this event! Later we had a fun ice breaker CSD event, \'The Technical Glitch\' where people shared their funny, embarrassing and a few amazing stories while they used different gadgets. Everyone enjoyed this session and bonded over laughter and had an amazing evening together.','https://www.instagram.com/p/CC6aCgnA1rH/?utm_source=ig_web_copy_link','59de4d891e8742be959eccf7e43a73dc','217239-2020-07'),(349,'2020-07-19 00:00:00.000000','\"बेखौफ, आज़ाद है जीना मुझे!\"','IS','7','10','0','This event was an initiative by Rotaract Club of Panvel Central in collaboration with  RC Calcutta, RC Social crew, Jharkhand, RC Thane Towning, RC Pune Hillside,  RC Bombay Queenstown Front, RC Electrical MCOE Metro and Nacho Salsa ( a YouTube Dance Tutorial channel). The First Women\'s Rights Movement was executed on 19th July, 1848. To mark this day we express our much deserved freedom in a fun filled way by dancing our hearts out to the upbeat song,\"KUDI NU NACHNE DE\", a song supporting to de-stigmatize the social views towards women! ','https://www.instagram.com/tv/CC6ePcxAkDw/?utm_source=ig_web_copy_link','59de4d891e8742be959eccf7e43a73dc','217239-2020-07'),(350,'2020-07-19 00:00:00.000000','बालतरू','CM','11','5','0','We Collaborated for the event \'बालतरू\' initiated by Rotaract Club of SAOE in which all the respective RaC Pune HillSide team participated with great enthusiasm. Due to situation all the members planted plants in their home itself as per the guidelines and took pics of the moment. The event was conducted on 19th July 2020. ','https://www.instagram.com/p/CC6cj6ogxtX/?utm_source=ig_web_copy_link','59de4d891e8742be959eccf7e43a73dc','217239-2020-07'),(351,'2020-07-20 00:00:00.000000','Plant From Home','CM','11','5','0','We Collaborated for the event \'Plant From Home\' initiated by RCP Urja in which all the respective RaC Pune HillSide team participated with great enthusiasm. Due to situation all the members planted plants in their home itself as per the guidelines and took pics of the moment. The event duration was from 15th - 20th July 2020. ','https://www.instagram.com/p/CC6fmfAgGKx/?utm_source=ig_web_copy_link','59de4d891e8742be959eccf7e43a73dc','217239-2020-07'),(352,'2020-07-22 00:00:00.000000','Ouchkars','CS','14','12','0','We Rotaract Club of Pune Hillside on the occasion of our FIRST CHARTER BIRTHDAY! celebrated an \'Ouchkars\' awards night! On 22nd of July. Everyone had a great time! and it was an evening worth spending with all our members all dressed up for this evening.','https://www.instagram.com/p/CDe6MwfAS1U/?utm_source=ig_web_copy_link','59de4d891e8742be959eccf7e43a73dc','217239-2020-07'),(353,'2020-07-24 00:00:00.000000','Knowing R','CS','9','4','0','All of the Rotaractors introduced to the members of the Sponsor Rotary for creating a good bond and erasing the boundaries of being two entities.','https://www.instagram.com/p/CDsvBAFARye/?utm_source=ig_web_copy_link','59de4d891e8742be959eccf7e43a73dc','217239-2020-07'),(354,'2020-07-26 00:00:00.000000','Life of an Armyman','PD','12','8','0','We, Rotaract Club of Pune Hillside along with RC Panvel Industrial Town, RC Pune Aundh, RC Panvel Mahanagar, RC Vascodigama Goa, RC Bibwewadi, RC Vibrants, RC Panvel Sunrise, RC Gurugram Midwest conducted an RRRO, ISD and PD event on the occasion of Kargil Vijay Divas, we had a honorary member of our Sponsor Rotary, Major General (Retd) J N Nayar tell us about what life was like during Kargil. He also spoke about what his experience from the Army was and what he learnt from it. We held a Question and Answer session after it where the Audience had a lot of questions for the speaker. ','https://www.instagram.com/p/CDe3nxnAO26/?utm_source=ig_web_copy_link','59de4d891e8742be959eccf7e43a73dc','217239-2020-07'),(355,'2020-07-26 00:00:00.000000','FamExpresso','IS','5','3','0','FamExpre