n with us ','https://www.instagram.com/p/CDB-Tj-AxHl/?utm_source=ig_web_copy_link','87f944413a5c4fa980b92530548ce2aa','45125-2020-07'),(373,'2020-07-26 00:00:00.000000','The chatterbox Colony ','CS','14','3','00','We conducted a joint CSD event - The chatterbox Colony jointly with RC Alumni -It was a fun interactive session conducted by the CSD\'s for our club members.','https://www.instagram.com/p/CDK2Wr9ABn1/?utm_source=ig_web_copy_link','87f944413a5c4fa980b92530548ce2aa','45125-2020-07'),(374,'2020-07-29 00:00:00.000000','Barish ke Nagme - Online Concert ','CS','5','3','00','We conducted a online musical concert - Along with our parent rotary club which consisted of songs related to monsoon and enjoyed a musical evening .','https://www.instagram.com/p/CDVWZZwAT9O/?utm_source=ig_web_copy_link','87f944413a5c4fa980b92530548ce2aa','45125-2020-07'),(381,'2020-07-01 00:00:00.000000','BEHIND THE WHITE COAT','IS','22','5','0',' Behind the White Coat was an ISD/Presidents initiative from 70+ clubs across the Globe wherein videos of Doctors and their families were collected and posted on the YouTube channel. Link for our club participation: https://youtu.be/2hsUUg_yzdM','-','9372373310d5404fb0d616b5c91dc4f1','215769-2020-07'),(382,'2020-07-01 00:00:00.000000','BEHIND THE WHITE COAT','CM','22','5','0',' Behind the White Coat was an ISD/Presidents initiative from 70+ clubs across the Globe wherein videos of Doctors and their families were collected and posted on the YouTube channel. Link for our club participation: https://youtu.be/2hsUUg_yzdM','-','9372373310d5404fb0d616b5c91dc4f1','215769-2020-07'),(383,'2020-07-09 00:00:00.000000','THE LITTLE PAW','IS','19','5','0',' In collaboration with RaC Panvel Central we had a CMD event conducted under which our club members clicked and shared pictures of them feeding the stray dogs.','-','9372373310d5404fb0d616b5c91dc4f1','215769-2020-07'),(384,'2020-07-09 00:00:00.000000','THE LITTLE PAW','CM','19','5','0',' In collaboration with RaC Panvel Central we had a CMD event conducted under which our club members clicked and shared pictures of them feeding the stray dogs.','-','9372373310d5404fb0d616b5c91dc4f1','215769-2020-07'),(385,'2020-07-11 00:00:00.000000','Ice breaker with club BOD','CS','14','4','0','This was our first club service bonding session for the board of members, so that we get to know each other better. We played two games ‘Two Truths & One Lie’ and ‘Guess Who’,For ‘Two Truths & One Lie’, CSD asked everyone to prepare three statements without mentioning which one is a lie and everyone had to guess which statement from the three is false. For ‘Guess Who’, I had asked all the members one day before to send me any kind of embarrassing, funny thing about them. During the game night I randomly sent those statements to anyone and they had to guess whose statement it was.  If they guessed it wrong they had to do a fun punishment which everyone would ask them to do.','https://www.instagram.com/p/CDVCnjygGJh/?igshid=13od302l4wrhf','9372373310d5404fb0d616b5c91dc4f1','215769-2020-07'),(386,'2020-07-11 00:00:00.000000','Life as a Hobby','PD','26','5','0','In collaboration with RCP Zenith an interactive session taken by Mr. Milind Tambe (ex-Navy officer now a consultant) on how having a hobby that brings us joy and enriches our lives. It\'s about how one can practice their hobby on daily basis and in some situations how can they convert their hobby into full time earning! Hence, it\'s said - a hobby a day keeps the doldrums away!','https://www.instagram.com/p/CDQg6WcAsXB/?igshid=xt51bibn92bw','9372373310d5404fb0d616b5c91dc4f1','215769-2020-07'),(387,'2020-07-13 00:00:00.000000','Board of directors meeting','CS','14','2','0','Board registration fees. Resolution and discussion on change of parent rotary and proposed parent rotary. PID,PRO,WR,FD plans and callendar discussion. Resolution for purchanse of online zoom platform for online meetings and events. discussion and resolution which logo to be used for which event. updates on registration of 2 bod each. PERITUS 1.0 discussion. SRDF discussion. Avenue wise budgeting. Orientation. Creatives to be done 3-4 days prior to event. Lacking in PR from bod. GBM meeting plans and date.','-','9372373310d5404fb0d616b5c91dc4f1','215769-2020-07'),(388,'2020-07-16 00:00:00.000000','PLASMA DONATION AWARENESS','IS','43','2','0',' Initiative to post daily social media posts generating awareness on Plasma Donation for COVID-19 patients. Club members participated with great athusiasm and helped in spreading the awareness.','-','9372373310d5404fb0d616b5c91dc4f1','215769-2020-07'),(389,'2020-07-17 00:00:00.000000','Ice breaker with GBM','CS','39','3','0','This was our first club service bonding session for the general body member, so that all of us would get to know each other better. We have a few members that were completely new to Rotaract, so we gave them a short introduction on all the Avenues and what we do, For activity we had prepared a few imaginary questions, where all the GBM’s had to give funny imaginary answers and tell what they think about it.Overall it was a fun activity and an amazing icebreaker since we had some casual & random questions where everyone got involved.','https://www.instagram.com/p/CDfjG7PAIWf/?igshid=dn5e0a8r0hzr','9372373310d5404fb0d616b5c91dc4f1','215769-2020-07'),(390,'2020-07-19 00:00:00.000000','Meditative Mandala','PD','24','6','0','In Collaboration with RC Vibrants this event was hosted, Mandalas are concentric, geometric forms that are easy to design and draw. The benefits of Mandala are - helps calm thoughts and emotions, a fulfilling form of self-expression, becoming cantered and balanced!Session was taken by District Editor Rtr. Amaraja Sathe and then it was followed by an ice breaker session with RC Vibrants.','https://www.instagram.com/p/CDRrf6fANSX/?igshid=10xqpbalni4ec','9372373310d5404fb0d616b5c91dc4f1','215769-2020-07'),(391,'2020-07-19 00:00:00.000000','“PERITUS 1.0 - CREATING THE LEADERS','IS','18','6','0','On the International Youth Skills Day 2020, Rotaract Club of Pune Salisbury Park along with 6 Host Clubs from RID 3131 and over 20 collaborating clubs came up with a Learning &amp; Growing Initiative.A competition for showcasing your skills and then becoming a leader to guide others to take up that skill. 10 Skills~10 Leaders! In 2 Hours we delivered the basics of over 10 Skills like painting, baking, video making, acting, etc. Leaders Creating Event by giving opportunity to grow; aptly Saying,;Rotaract for Excelling ; Growing through Opportunities','https://www.instagram.com/p/CC3mdZ2A3Fa/?igshid=tt7nv37vqj1t','9372373310d5404fb0d616b5c91dc4f1','215769-2020-07'),(392,'2020-07-23 00:00:00.000000','Board of directors meeting','CS','15','2','0','Rotaract Protocols. Detail discussion for GVL - Atmanirbhar event. Short introduction of Roles. Flow of the Event. Main Agenda Discussion. PR Strategy/How to reach out to max participants. Buffer entertainment discussion. Updates on Posters and Flyers. Assignment of MOC duties. Conclusive summary. Resolution for outsourcing the creative for Atmanirbhar event.  Conclusion. Rotaract Protocols. Adjournment.','-','9372373310d5404fb0d616b5c91dc4f1','215769-2020-07'),(393,'2020-07-26 00:00:00.000000','Atmanirbhar Bharat','PD','186','12','0','A session on Atmanirbhar Bharat given by honourable Shri GVL Narsimha Rao ji, who is the member of parliament!Business is something which we all want to do but the current scenario or our financial situation never permitted us to do the same, so this was an interactive session with GVL Narsimha Rao himself teaching on how should we become Atmanirbhar. He also made us all take an oath that we would only purchase things which were local!','https://www.instagram.com/p/CDO_C7zA6Ga/?igshid=1p37qwsgb810m','9372373310d5404fb0d616b5c91dc4f1','215769-2020-07'),(394,'2020-07-26 00:00:00.000000','Vivekananda series chapter 1','PD','8','3','0','In collaboration with RCP wa